  const getUsers = () => {
    fetch("http://localhost:5500/user/1", {
      method: "GET",
    })
      .then((response) => response.json())
      .then((json) => console.log(json));
  };

  return (
    <div>
      <button onClick={getUsers}> Получить пользователей</button>
    </div>
  );
}

export default App;
